    useEffect(() => {
        const fetchData = async () => {
          try {
            const response = await axios.post('http://172.17.15.186:3006/sreports', {studentid} );
            console.log("HHJJUJIUHjgb")
            console.log(response.data);
            setData(response.data);
          } catch (error) {
            setError(error);
          } finally {
            setLoading(false);
          }
        };

        fetchData();
      }, []); 
  return (
    <div>StudentReport</div>
  )
}

